import React from 'react'

import './input.css'

const Input = (props) => {
  return (
    <div className="input_form">
      {(emailDirty && emailError) && <div style={{color: 'red'}}>{emailError}</div>}
      <label>
        <input value={email} onBlur={e => blurHandler(e)} className="form_input" name="login" type={props.type} placeholder={props.placeHolder}></input>
      </label>
      
      {(passwordDirty && passwordError) && <div style={{color: 'red'}}>{passwordError}</div>}
      <label>
        <input value={password} onBlur={e => blurHandler(e)} className="form_input" name="login" type={props.typePass} placeholder={props.placeHolderPass}></input>
      </label>
    </div>
    
    
  )
}
Input.defaultProps = { type: "text", placeHolder: ""};

export default Input
